class SplashScreen extends StatefulWidget {
  final Color backgroundColor = LightColors.kbluel;
  final TextStyle styleTextUnderTheLoader = TextStyle(
      fontSize: 18.0, fontWeight: FontWeight.bold, color: Colors.black);

  @override
  _SplashScreenState createState() => _SplashScreenState();
}

class _SplashScreenState extends State<SplashScreen> {
  final splashDelay = 5;
  DateTime selectedDate;

  Future<SharedPreferences> _prefs;
static const image ="assets/images/floor10.svg";
  @override
  void initState() {
    super.initState();

    _loadWidget();
  }

  _loadWidget() async {
    selectedDate=  DateTime.now();
    var _duration = Duration(seconds: splashDelay);
   Timer(_duration, navigationPage);

  }

  void navigationPage() {

    _prefs = SharedPreferences.getInstance();
    _prefs.then((SharedPreferences prefs) => {
      if (prefs.containsKey("token"))
        {
/*          Navigator.pushReplacement(
            context,
        MaterialPageRoute(builder: (context) => FirstPage()),
           )*/
              Navigator.pushReplacement(
              context,
              MaterialPageRoute(builder: (context) =>
                  navigationScreen(
                      0,
                      null,
                      null,
                      0,
                      "",
                      selectedDate,
                      "home"))
          )
        }  else {  Navigator.pushReplacement(context,
          MaterialPageRoute(builder: (BuildContext context) => SignInScreen(selectedDate))) }
    });

  }

